import React, { useState } from "react";
import { apiCall } from './utils/apiCall';


function Home() {

    const [student, setStudent] = useState('');
    const [test, setTest] = useState('');

    function getStudents(){
        apiCall('/user/student', 'get').then(res=>{
            setStudent(res.data)
        })
    }

    function getTest(){
        apiCall('/user/test', 'get').then(res=>{
            setTest(res.data)
        })
    }


    return (
        <div className="row">
                    {
                        student
                    }

                    {
                        test
                    }
                    <button onClick={getStudents} className="btn btn-info">student</button>
                    <button onClick={getTest} className="btn btn-info mx-2">test</button>
        </div>
    )
}

export default Home;
